import React, { useState } from "react";
import axios from "axios";
import Footer from "../component/Footer";

const SellerAdsForm = () => {
  const [formData, setFormData] = useState({
    productName: "",
    price: "",
    stockStatus: "",
    image: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, image: e.target.files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    data.append("productName", formData.productName);
    data.append("price", formData.price);
    data.append("stockStatus", formData.stockStatus);
    data.append("image", formData.image);

    try {
      const response = await axios.post("/seller/ads", data, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      console.log(response.data);
      alert("Ad submitted successfully!");
    } catch (error) {
      console.error("Error submitting ad:", error);
      alert("Failed to submit ad.");
    }
  };

  return (
    <div className=" p-5 w-full  bg-cover bg-center">
      <div className="max-w-md mx-auto p-6 bg-green-200 rounded-lg shadow-lg mt-10 m-10 ">
        <h2 className="text-3xl text-green-700 text-center mb-6 font-extrabold">
          Submit Your Ads
        </h2>
        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label
              className="block text-green-800 font-semibold mb-2"
              htmlFor="productName"
            >
              Product Name
            </label>
            <input
              type="text"
              name="productName"
              id="productName"
              value={formData.productName}
              onChange={handleChange}
              required
              className="w-full px-3 py-2 border border-green-300 rounded focus:outline-none focus:ring-2 focus:ring-green-500"
            />
          </div>
          <div>
            <label
              className="block text-green-800 font-semibold mb-2"
              htmlFor="price"
            >
              Price
            </label>
            <input
              type="number"
              name="price"
              id="price"
              value={formData.price}
              onChange={handleChange}
              required
              className="w-full px-3 py-2 border border-green-300 rounded focus:outline-none focus:ring-2 focus:ring-green-500"
            />
          </div>
          <div>
            <label className="block text-green-800 font-semibold mb-2">
              Stock Status
            </label>
            <div className="flex space-x-4">
              <label className="flex items-center">
                <input
                  type="radio"
                  name="stockStatus"
                  value="Available"
                  checked={formData.stockStatus === "Available"}
                  onChange={handleChange}
                  required
                  className="text-green-500 focus:ring-green-500"
                />
                <span className="ml-2 text-green-700">Available</span>
              </label>
              <label className="flex items-center">
                <input
                  type="radio"
                  name="stockStatus"
                  value="Stock Out"
                  checked={formData.stockStatus === "Stock Out"}
                  onChange={handleChange}
                  className="text-green-500 focus:ring-green-500"
                />
                <span className="ml-2 text-green-700">Stock Out</span>
              </label>
            </div>
          </div>
          <div>
            <label
              className="block text-green-800 font-semibold mb-2"
              htmlFor="image"
            >
              Product Image
            </label>
            <input
              type="file"
              name="image"
              id="image"
              onChange={handleFileChange}
              required
              className="w-full text-green-700"
            />
          </div>
          <button
            type="submit"
            className="w-full py-2 px-4 bg-green-700 text-white font-semibold rounded hover:bg-green-600 focus:outline-none focus:ring-2 focus:ring-green-500"
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default SellerAdsForm;
